Passage: (CNN) -- Brittany Wenger learned about artificial intelligence during a seventh-grade school project. She was immediately enthralled, bought a book on programming and taught herself how to code. Now 17, Wenger won the grand prize at the second annual Google Science Fair on Monday for her project on improving breast cancer diagnosis accuracy using artificial neural networks. That combination of drive, passion for science and a desire to do something good was common at this year's event. Organizers of the online science fair received thousands of entries from 100 countries, including India, Ukraine, Malta and Swaziland. Google picked 15 finalists and, at a final gala in an airplane hangar in Palo Alto, announced the winners in three age categories, along with a grand-prize winner.
@highlight
