Passage: (CNN) -- Over the course of five days, the Greek government -- led by the understated conservative Prime Minister Antonis Samaras -- overcame two high hurdles in a dash to qualify for the austerity program set out by the so-called troika, made up of the European Central Bank, the International Monetary Fund and the European Commission. The first hurdle was the parliamentary vote last week, when the austerity measures were passed by just 153 votes out of 300. The second important vote took place in the wee hours of Sunday night in Athens, this time with a comfortable margin of victory as 167 of 300 lawmakers voted for, in essence, more austerity.
@highlight
