Query: Some 70,000 workers took to the streets in central @placeholder last week for one last fight of resistance against the austerity.

Passage: London (CNN) -- Seven promising young British athletes lit the Olympic cauldron early Saturday, capping the Games' festive opening ceremony in east London. The torch, which arrived on a boat driven by football star David Beckham down the River Thames, had been carried into the stadium by five-time Olympic gold medalist Steve Redgrave. The retired rower then passed it to the young athletes, who lit part of the outer rim of the torch, setting off a domino effect as fire spread to 205 small metal "petals," symbolizing the nations taking part. The small petals eventually rose on long stems and converged to become a cauldron pointing up to the sky above the stadium.
