Passage: (CNN)  -- Despite reports this week of a return to normalcy on the Egyptian street, the situation on the ground is anything but: Protests continue while statements from the nation's leaders have served only to maintain or even stoke the tinderbox status of negotiations. Demonstrations, which Human Rights Watch says have killed more than 300 people, continued for a 16th day in Cairo's Tahrir Square. "Nothing will make this regime go unless we keep on coming and keep on coming," said Dalia, a protester there who did not give her last name. Another group of protesters tried to prevent the army from breaking up a demonstration at the parliament building in Cairo, and in the northern city of Port Said, state-run TV reported that Egyptians upset over the distribution of land and houses attacked a governor's building.
