Passage: (CNN) -- U.N. Secretary-General Ban Ki-moon is questioning the effectiveness of the manhunt for fugitive warlord Joseph Kony and his Lord's Resistance Army, saying African Union troops are short on equipment, food and transportation. In a 14-page report to the U.N. Security Council, Ban urged member nations to provide the needed resources, warning the troops would be able to carry out their mission. "The initiative itself lacks adequate and predictable funding for its operations. Without the necessary resources, the African Union will be unable to execute this important task fully," Ban said in the report released Thursday. The African Union stepped up efforts this year to capture Kony, deploying 5,000 troops in March after a resurgence in attacks by the group left thousands dead and displaced 445,000 people in Uganda, South Sudan, the Democratic Republic of Congo and the Central African Republic, according to U.N. estimates.
